import Image from 'next/image'

const CustonBanner = () => {
  return (
    <>
        <Image src="/banner.svg" alt="me" layout='fill'/>
        <style jsx>
            {`
                Image {
                    display:none

                }
                button:active {
                    border: solid 1px ${palett.white};
                    position:relative;
                    top:1px;
                }
                .btnRed {
                    background-color: ${palett.primary.main};
                    color: ${palett.white};
                }
                .btnRed:hover {
                    background-color: ${palett.primary.light};
                }
                .btnWhite {
                    background-color: ${palett.white};
                    color: ${palett.text.btn.dark};
                }
                .btnWhite:hover {
                    background-color: #f5f5f5;
                }
            `}
        </style>
    </>
    )
}

export default CustonBanner
